function toggleAvailability(a){a.hasClass("calendar-unavailable")?(a.removeClass("calendar-unavailable"),a.addClass("calendar-available"),a.find("a").text("Mark Unavailable")):(a.removeClass("calendar-available"),a.addClass("calendar-unavailable"),a.find("a").text("Mark Available"))}$(".js-toggle-available").click(function(){var a=$(this),l=a.attr("href");return $.ajax(l,{type:"put",success:function(l){console.log(l),toggleAvailability(a.parent())},error:function(){console.log("error")}}),!1});